// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import './App.css';
import Header from './components/Header';
import Banner from './components/Banner';
import CourseCard from './components/CourseCard';

function App() {
  return (
    <Router>
      <div className="App">
        <Header />
        <Routes>
          <Route path="/" element={<Banner />} />
          <Route path="/courses" element={
            <div className="course-list">
              <CourseCard title="AWS" image="aws-image-url" />
              <CourseCard title="Supabase with Next.js" image="supabase-nextjs-image-url" />
              <CourseCard title="Business PM" image="business-pm-image-url" />
              <CourseCard title="CS" image="cs-image-url" />
            </div>
          } />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
